import React, { useState } from "react";
import styles from "../Aievents.module.css";

export default function Aievents() {
  const [currentDate, setCurrentDate] = useState(new Date());

  const previousWeek = () => {
    const newDate = new Date(currentDate);
    newDate.setDate(newDate.getDate() - 7);
    setCurrentDate(newDate);
    console.log(currentDate);
  };

  const nextWeek = () => {
    const newDate = new Date(currentDate);
    newDate.setDate(newDate.getDate() + 7);
    setCurrentDate(newDate);
    console.log(currentDate);
  };
  const getDayName = (date) => {
    const daysOfWeek = [
      "Sunday",
      "Monday",
      "Tuesday",
      "Wednesday",
      "Thursday",
      "Friday",
      "Saturday",
    ];
    return daysOfWeek[date];
  };
  const getMonthName = (date) => {
    const monthsOfYear = [
      "January",
      "February",
      "March",
      "April",
      "May",
      "June",
      "July",
      "Aug",
      "September",
      "October",
      "November",
      "December",
    ];
    return monthsOfYear[date];
  };

  const renderDates = () => {
    const dates = [];
    for (let i = 0; i < 7; i++) {
      const date = new Date(currentDate);
      date.setDate(currentDate.getDate() + i);
      dates.push(
        <div key={i} className={styles[22]}>
          <div className={styles.jul}>
            {date.getDate()} {getMonthName(date.getMonth())}
          </div>
          <div className={styles.sun}>{getDayName(date.getDay())}</div>
        </div>
      );
    }
    return dates;
  };

  return (
    <>
      <div>
        <div>
          <div>
            <div>Ai Event</div>
            <div>list of </div>
          </div>
          <div>
            <div>Event noti report</div>
            <div>all device prev next</div>
          </div>
        </div>
        <div>
          <div>15</div>
          <div>16</div>
          <div>16</div>
          <div>16</div>
          <div>16</div>
          <div>16</div>
          <div>16</div>
        </div>
      </div>
    </>
  );
}
